import Head from 'next/head';
import styled from 'styled-components';
const Container = styled.div`

  width: 700px;
  margin: 0 auto;
`


export default function Layout({ children }) {
  return (
    <div>
      <Head>
        <title>InfoCasas</title> 
      </Head> 
      <main>
        <Container>
        {children}
        </Container>
      </main>

      <style jsx global>
        {`
          html,
          body {
            padding: 0;
            margin: 0;
          }
          * {
            box-sizing: border-box;
          }

        `}
      </style>
    </div>
  )
}

